const Home = ({ feed }) => {
  return (
    <div>
      {feed.map((post) => {
        return (
          <div>
            <img src={post.image} alt={post.title} />
            <h4>{post.title}</h4>
            <p>By: {post.author}</p>
          </div>
        );
      })}
    </div>
  );
};

export default Home;
